import React from 'react';
import Nav from '../components/Nav';
import Footer from '../components/Footer';

// Mock data based on "Contact details for banks.docx" (replace with your actual data)
const bankContacts = [
  {
    name: 'Barclays',
    customerService: '0345 734 5345',
    fraud: {
      debitCard: '0800 389 1652',
      creditCard: '0800 389 1652',
      onlineBanking: '0800 389 1652',
    },
    international: '+44 1928 584 421',
    notes: 'Available 24/7 for fraud reports.',
  },
  {
    name: 'HSBC',
    customerService: '0345 740 4404',
    fraud: {
      debitCard: '0345 600 7010',
      creditCard: '0345 600 7010',
      onlineBanking: '0345 600 7010',
    },
    international: '+44 1226 261 010',
    notes: 'Call immediately if you suspect fraud.',
  },
  // Add more banks as per your document
];

function FraudContacts() {
  return (
    <div className="min-h-screen bg-gradient-to-b from-white to-gray-100">
      <Nav />
      <div className="pt-20 pb-10 max-w-3xl mx-auto px-4">
        <h1 className="text-3xl font-semibold text-gray-900 mt-8 mb-6">Fraud Contacts</h1>
        <p className="text-base text-gray-600 mb-6">Contact your bankâ€™s fraud team immediately if you suspect fraudulent activity. Below are key numbers for major UK banks.</p>

        {bankContacts.map((bank) => (
          <section key={bank.name} className="bg-white p-6 rounded-xl shadow-md mb-6">
            <h2 className="text-xl font-medium text-gray-700 mb-4">{bank.name}</h2>
            <div className="text-base text-gray-600">
              <p><strong>Customer Service:</strong> {bank.customerService}</p>
              <p><strong>Fraud - Debit Card:</strong> {bank.fraud.debitCard}</p>
              <p><strong>Fraud - Credit Card:</strong> {bank.fraud.creditCard}</p>
              <p><strong>Fraud - Online Banking:</strong> {bank.fraud.onlineBanking}</p>
              <p><strong>International:</strong> {bank.international}</p>
              {bank.notes && <p className="text-sm text-gray-500 mt-2">{bank.notes}</p>}
            </div>
          </section>
        ))}
      </div>
      <Footer />
    </div>
  );
}

export default FraudContacts;
